import { Component } from '@angular/core';

@Component({
  selector: 'app-events',
  templateUrl: './events.component.html',
  styleUrls: ['./events.component.scss'],
})
export class EventsComponent {
  public events: any = [
    {
      Theme: 'Angular 15',
      Local: 'Salvador',
    },
    {
      Theme: '.NET',
      Local: 'São Paulo',
    },
    {
      Theme: 'Angular e suas novidades',
      Local: 'Belo Horizonte',
    },
  ];
}
<h1>Eventos de Componets</h1>
<p><b>Tema: </b>{{events[0].Theme}}</p>
<p><b>Local: </b>{{events[0].Local}}</p>

